-- ----------------------------
-- Table structure for trantal_object
-- ----------------------------
DROP TABLE IF EXISTS `trantal_object`;
CREATE TABLE `trantal_object` (
  `object_id` int NOT NULL AUTO_INCREMENT COMMENT '商品ID',
  `object_uuid` varchar(20) DEFAULT NULL COMMENT '商品编码',
  `object_name` varchar(30) DEFAULT NULL COMMENT '商品名称',
  `object_title` varchar(255) NOT NULL COMMENT '商品标题',
  `object_oldprice` float NOT NULL DEFAULT '0' COMMENT '商品原价',
  `object_price` float NOT NULL DEFAULT '0' COMMENT '商品当前售价',
  `object_info` varchar(1000) DEFAULT NULL COMMENT '商品信息',
  `object_cout` int DEFAULT '0' COMMENT '商品数量',
  `object_image` varchar(1000) DEFAULT NULL COMMENT '商品图片',
  `object_status` int NOT NULL DEFAULT '1' COMMENT '商品状态  1:正常\n2:下架',
  `object_time` date NOT NULL COMMENT '上架时间',
  `object_classes` int DEFAULT NULL COMMENT '商品分类',
  `user_id` int NOT NULL COMMENT '商家ID',
  `object_banner` varchar(255) DEFAULT NULL COMMENT '商家海报图',
  `object_img` varchar(1000) DEFAULT NULL COMMENT '商品详情图',
  PRIMARY KEY (`object_id`) USING BTREE,
  KEY `user_id` (`user_id`),
  KEY `classes` (`object_classes`),
  KEY `object_price` (`object_price`),
  CONSTRAINT `classes` FOREIGN KEY (`object_classes`) REFERENCES `object_classes` (`classes_id`),
  CONSTRAINT `user_id` FOREIGN KEY (`user_id`) REFERENCES `trantal_user` (`user_id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE=InnoDB AUTO_INCREMENT=48 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

