-- ----------------------------
-- Table structure for trantal_order
-- ----------------------------
DROP TABLE IF EXISTS `trantal_order`;
CREATE TABLE `trantal_order` (
  `order_id` int NOT NULL AUTO_INCREMENT COMMENT '订单ID',
  `order_uuid` varchar(24) NOT NULL COMMENT '订单编号',
  `user_id` int NOT NULL COMMENT '消费者ID',
  `object_id` int NOT NULL COMMENT '商品ID',
  `object_price` float NOT NULL COMMENT '商品售价',
  `order_cout` int NOT NULL COMMENT '商品总数',
  `order_cost` float NOT NULL COMMENT '订单消费金额',
  `order_info` varchar(255) DEFAULT NULL COMMENT '订单备注',
  `order_time` datetime NOT NULL COMMENT '下单时间',
  `order_track` varchar(50) DEFAULT NULL COMMENT '订单快递单号',
  `order_address` varchar(255) DEFAULT NULL COMMENT '订单地址',
  `order_name` varchar(255) DEFAULT NULL COMMENT '订单收件人姓名',
  `order_phone` varchar(255) DEFAULT NULL COMMENT '订单收件手机号',
  `order_status` int NOT NULL COMMENT '订单当前状态 0:待寄出\n1:寄出\n2:确认收货\n3:退货\n4.确认退货\n5.取消订单\n',
  PRIMARY KEY (`order_id`),
  KEY `order_object_id` (`object_id`),
  KEY `order_user_id` (`user_id`),
  CONSTRAINT `order_object_id` FOREIGN KEY (`object_id`) REFERENCES `trantal_object` (`object_id`) ON UPDATE RESTRICT,
  CONSTRAINT `order_user_id` FOREIGN KEY (`user_id`) REFERENCES `trantal_user` (`user_id`) ON UPDATE RESTRICT
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

