-- ----------------------------
-- Table structure for trantal_shop
-- ----------------------------
DROP TABLE IF EXISTS `trantal_shop`;
CREATE TABLE `trantal_shop` (
  `shop_id` int NOT NULL AUTO_INCREMENT COMMENT '购物车ID',
  `user_id` int NOT NULL COMMENT '消费者ID',
  `object_id` int NOT NULL COMMENT '商品ID',
  `shop_cout` int NOT NULL COMMENT '加入购物车商品数量',
  `shop_time` datetime NOT NULL COMMENT '加入购物车时间',
  `shop_status` int NOT NULL COMMENT '购物车该内容状态 1:为正常\n0:已删除\n',
  PRIMARY KEY (`shop_id`),
  KEY `shop_user` (`user_id`),
  KEY `shop_object` (`object_id`),
  CONSTRAINT `shop_object` FOREIGN KEY (`object_id`) REFERENCES `trantal_object` (`object_id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `shop_user` FOREIGN KEY (`user_id`) REFERENCES `trantal_user` (`user_id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

