-- ----------------------------
-- Table structure for trantal_user
-- ----------------------------
DROP TABLE IF EXISTS `trantal_user`;
CREATE TABLE `trantal_user` (
  `user_id` int NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `user_account` varchar(6) NOT NULL COMMENT '用户昵称',
  `user_name` varchar(5) NOT NULL COMMENT '用户姓名',
  `user_phone` varchar(20) NOT NULL COMMENT '用户手机号',
  `user_email` varchar(20) NOT NULL COMMENT '用户邮箱',
  `user_password` varchar(64) NOT NULL COMMENT '账户密码',
  `user_time` datetime NOT NULL COMMENT '注册时间',
  `user_last` datetime NOT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '最后登录时间',
  `user_level` int NOT NULL DEFAULT '1' COMMENT '用户登记 0:用户\n1:商家\n2:管理员\n',
  `user_status` int NOT NULL DEFAULT '1' COMMENT '账户状态 1:正常，2封禁',
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `userAccount` (`user_account`),
  UNIQUE KEY `userId` (`user_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

